accuracy = 4  # 小数部分精度

def dtb(num):
    # 判断是否为浮点数
    if num == int(num):
        # 若为整数
        integer = '{:08b}'.format(int(num))  # {:08b} ：高位补0
        return integer
    else:
        # 若为浮点数
        # 取整数部分
        integer = int(num)
        # 取小数部分
        flo = num - integer
        # 整数部分进制转换
        integercom = '{:08b}'.format(integer)
        # 小数部分进制转换
        tem = flo
        tmpflo = []
        for i in range(accuracy):
            tem *= 2
            tmpflo += str(int(tem))
            tem -= int(tem)
        flocom = tmpflo
        return integercom + '.' + ''.join(flocom)


def cut(value):
    length = 1
    l = value
    while True:
        if len(set(l)) < (len(value) / length)*0.9 :
            length += 1
            l=[]
            for i in range(int(len(value)/length)):
                temp = ''
                for j in range(length):
                    temp = temp+value[i*(length)+j]
                l.append(temp)
            continue
        else:
            return length,l



