def draw_pic(loss):
    loss = list(np.ravel(loss))
    plt.figure(figsize=(15, 4), dpi=100)
    plt.subplot(1, 3, 1)
    result =[]
    temp=0
    for i in range(len(loss)):
        temp = temp+loss[i]
        if (i+1)%1 ==0:
            temp=temp/1
            result.append(temp/1000000)
            temp=0

    x1 = range(500)
    y1 = result
    plt.title("Loss of 500 episodes")  # 设置标题
    plt.xlabel("Episodes")  # 设置x坐标标签
    plt.ylabel("Score")  # 设置y坐标标签
    plt.plot(x1, y1)

    plt.subplot(1, 3, 2)
    result = []
    temp = 0
    for i in range(len(loss)):
        temp = temp + loss[i]
        if (i + 1) % 10 == 0:
            temp = temp / 10
            result.append(temp/1000000)
            temp = 0

    x1 = range(50)
    y1 = result
    plt.title("Loss of 500 episodes")  # 设置标题
    plt.xlabel("Episodes/10")  # 设置x坐标标签
    plt.ylabel("Score")  # 设置y坐标标签
    plt.plot(x1, y1)

    plt.subplot(1, 3, 3)
    result = []
    temp = 0
    for i in range(len(loss)):
        temp = temp + loss[i]
        if (i + 1) % 50 == 0:
            temp = temp / 50
            result.append(temp/1000000)
            temp = 0

    x1 = range(10)
    y1 = result
    plt.title("Loss of 500 episodes")  # 设置标题
    plt.xlabel("Episodes/50")  # 设置x坐标标签
    plt.ylabel("Score")  # 设置y坐标标签
    plt.plot(x1, y1)
    plt.show()
